// src/components/Projects.js
import React from 'react';
//import './Projects.css';

const Projects = () => (
  <section id="projects">
    <h2>Projects</h2>
    <ul>
      <li>
        <h3>Project Title</h3>
        <p>Description of the project.</p>
        <a href="project-link">View Project</a>
      </li>
      {/* Add more projects as needed */}
    </ul>
  </section>
);

export default Projects;
